INSERT INTO `questions` (`id`, `question_text`, `question_type_id`, `priority`, `quiz_id`, `point`, `added_date`, `parent_id`, `question_total`, `check_total`, `header_text`, `footer_text`, `question_text_eng`, `help_image`) VALUES
(1, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Swati spends 40% of her salary on food, 25% on house rent, 15% on Entertainment and 5% on conveyance. If her saving at the end of a month is Rs 1200, then her salary per month is Rs ______?</div>\n', 1, 1, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(2, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A school has only three classes which contain 40, 50 and 60 students respectively. The pass percentages of these classes are 10, 20 and 10 respectively. The pass percentage of the school is ______%?</div>\n', 1, 2, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(3, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">If X% of a is the same as Y% of b, the Z% of b is _______?</div>\n', 1, 3, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(4, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">An increase of Rs 60 in the monthly salary of Madan made it 50% of the monthly salary of Kamal. What is Madan&rsquo;s present monthly salary?</div>\n', 1, 4, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(5, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">300 grams of sugar solution has 40% sugar in it. How much sugar should be added to make it 50% in the solution?</div>\n', 1, 5, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(6, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The income of a broker remains unchanged though the rate of commission is increased from 4% to 5%. The percentage slump in business is ______?</div>\n', 1, 6, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(7, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Two numbers are less than a third number by 30% and 37% respectively. How much percent is the second number less than the first?</div>\n', 1, 7, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(8, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">In an examination, 35% of total student failed in Hindi, 45% failed in English and 20% in both. The percentage of those who passed in both the subjects is ________%?</div>\n', 1, 8, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(9, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">There are 600 boys in a hostel. Each plays either hockey or football or both. If 75% play hockey and 45% play football, how many play both?</div>\n', 1, 9, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(10, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Raman&rsquo;s salary was decreased by 50% and subsequently increased by 50%. He has a loss of _______%?</div>\n', 1, 10, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(11, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">On increasing the price of T.V. sets by 30% their sale decreased by 20%. What is the effect on the revenue receipts of the shop?</div>\n', 1, 11, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(12, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The price of sugar increases by 20%.  By what percent must a house wife reduce the consumption of sugar, so that the expenditure on sugar is the same as before?</div>\n', 1, 12, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(13, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The value of a machine depreciates at the rate of 10% every year. It was purchased 3 years ago. If its present value is Rs 8748, its purchase price was Rs __________?</div>\n', 1, 13, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(14, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The length of a rectangle is increased by 20% and the width is decreased by 20%. The area changes by________%?</div>\n', 1, 14, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(15, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">A cricket team won 40% of the total number of matches it played during a year. If it lost 50% of the matches played and 20 matches were drawn, then the total number of matches played by the team during the year was _________? </div>\n', 1, 15, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(16, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">If the price of sugar is increased from Rs 6 per kg to Rs 7.50 per kg, then how much use of sugar a person should reduce so that, the expenditure on sugar doesn&rsquo;t change?</div>\n', 1, 16, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(17, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">Entry fee in an exhibition was Re 1. Later this was reduced by 25%, which resulted in 20% increase in sale. Find the percentage increase in the number of visitors?</div>\n', 1, 17, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(18, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The population of a city has increased at the rate of 10% every ten years. The present population is 48,400. What was it 20 yrs ago?</div>\n', 1, 18, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(19, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">The population of a town was 1,60,000 three yrs ago. If it had increased by 3%, 2.5% & 5% in the last-three years, find the present population?</div>\n', 1, 19, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
(20, '<div style=\"margin-bottom:7px;font-weight:bold;text-align:justify;\">In an election between two candidates, one got 55% of the total valid votes & 20% of the votes were invalid. If the total number of votes was 7500, the number of valid votes that the other candidate gotwas__________?</div>\n', 1, 20, 1, 1, '2024-01-27 05:15:15', 0, NULL, NULL, '', '', NULL, NULL),
